Les Petites Culottes De Ma Voisine (Les Comperes, Marc Dorcel / 2014)

Dans cet immeuble, il y a une salope a tous les etages : le reve de tout homme. Venez vite les decouvrir ! Les desirs de ces quatre magnifiques jeunes femmes ne connaissent aucune limite ! Entre les deux belles colocataires, la femme du concierge et la celibataire du quatrieme, les males de l?immeuble ont l?embarras du choix et comptent bien en profiter. Ils auraient bien tort de s?en priver? En se rendant a la laverie d?en face, la belle Emy tombe sur son charmant voisin. La sublime rouquine a la croupe accueillante va lui faire des avances qu?il ne saura refuser. Elle finira par atteindre un puissant orgasme anal en se faisant sodomiser contre le seche-linge. Pendant que Dixie s?offre encore une fois au vigoureux celibataire du troisieme etage, son concierge de mari visite tous les orifices humides de la belle Justine. Le moins que l?on puisse dire, c?est que cette brunette au cul de reve sait tres bien comment obtenir ce qu?elle desire. Alors que le facteur vient lui livrer ses sex toys et ses lubrifiants, la salope du quatrieme en profite immediatement pour essayer son materiel avec ce jeune fonctionnaire viril. Ce dernier se fera un devoir de jouir sur sa poitrine apres une belle seance de sexe anal.

